def main():
    st.set_page_config(
        page_title="Evidence Lower Bound (ELBO)",
        layout="wide",
        page_icon="https://user-images.githubusercontent.com/27728103/116659788-6a611a00-a992-11eb-9cc7-ce02db99f106.png"
    )

    col_left, col_right = st.columns((1, 1))

    col_left.title("Interactive ELBO plot")
    col_left.latex("""
        \\mathcal{{L}}(q(Z))
        =
        - \\mathbb{{KL}}(q(Z) || p(Z|X=\\mathcal{{D}}))
        +
        \\log(p(X=\\mathcal{{D}}))
    """)

    # The "True Posterior" is a univariate Gaussian Mixture Model
    # with three components
    true_posterior = tfp.distributions.MixtureSameFamily(
        mixture_distribution=tfp.distributions.Categorical(probs=mixture_probs),
        components_distribution=tfp.distributions.Normal(loc=mus, scale=sigmas)
    )

    # Mu can take any value
    # Sigma has to be strictly greater than 0
    mu_approx = col_left.slider(
        label="Mu Location of the Surrogate",
        min_value=-5.0,
        max_value=5.0,
        value=0.0,
        step=0.1,
    )
    sigma_approx = col_left.slider(
        label="Sigma of the Surrogate",
        min_value=0.1,
        max_value=5.0,
        value=1.0,
        step=0.1,
    )

    mu_entry_id = int(10.0 * (mu_approx + 5.0)) - 1
    sigma_entry_id = int(10.0 * (sigma_approx - 0.1)) - 1

    # The surrogate posterior q(Z) is a Normal
    # with parameters defined by the sliders
    surrogate_posterior = tfp.distributions.Normal(loc=mu_approx, scale=sigma_approx)
    col_left.latex(f"""
        q(Z)
        =
        \\mathcal{{N}} (Z; \\mu={mu_approx:}, \\sigma={sigma_approx:})
    """)

    # The eviden could be any value, since we don't
    # have access to the dataset
    # We not select it as the negative minium of our KL values.
    evidence = - tf.reduce_min(KL_VALUES)
    kl = KL_VALUES[sigma_entry_id, mu_entry_id].numpy()
    elbo = - kl + evidence

    col_left.latex(f"""
        \\underbrace{{{elbo:1.3f}}}_{{\\text{{ELBO}}}}
        =
        - \\underbrace{{{kl:1.3f}}}_{{\\text{{KL}}}}
        \quad
        +
        \quad
        \\underbrace{{{evidence:1.3f}}}_{{\\text{{Evidence}}}}
    """)

    # Watermark
    col_left.markdown("""
        Made with ❤️ by [Machine Learning & Simulation](https://www.youtube.com/channel/UCh0P7KwJhuQ4vrzc3IRuw4Q)
    """)

    z_values = tf.linspace(-5, 5, 100)
    z_values = tf.cast(z_values, tf.float32)
    prob_values_true = true_posterior.prob(z_values)
    prob_values_surrogate = surrogate_posterior.prob(z_values)

    figure = go.Figure(
        data=[
            go.Scatter(x=z_values, y=prob_values_true, mode="lines", name="True Posterior"),
            go.Scatter(x=z_values, y=prob_values_surrogate, mode="lines", name="Surrogate"),
        ],
        layout=go.Layout(
            xaxis={
                "gridcolor": "grey",
                "range": [-5.1, 5.1],
            },
            yaxis={
                "gridcolor": "grey",
                "range": [-0.1, 0.5],
            }
        )
    )
    col_right.plotly_chart(figure, use_container_width=True)


if __name__ == "__main__":
    main()